import React from "react"
import "./index.css"

function AddContent(){
    return(
        <div className="card">
            <table className="center">
                <td>
                <label>Item: <input type="text" name="name" width="100" className="buttonInp" /></label>
                </td>
                <td>
                <input type="button" value="Add item" className="buttonAdd"/>
                </td>
            </table>
        </div>
    );
}

export default AddContent;
